import './App.css';
import { Component } from 'react';
import { Header } from './components/Header'
import Lesson from './components/LessonBanner'
import Banner from './components/Banner';
import { SignInForm } from './components/SignInForm';
import WeeklyPhrase from './components/WeeklyPhrase';
import img9 from './components/img/image9.jpg'

class App extends Component {
  render() {
    return (
      <div className="App">

        <Header/>
        {/* <SignInForm/> */}
        <Banner/>
        <WeeklyPhrase/>
        <Lesson lessonNumber='3' 
                label='Freshman' 
                title='Animals' 
                description='Learning Learning Learning Learning Learning Learning all about animals: their names, habitats and other vocabulary (lalala)' 
                skills={['vocabulary', 'reading', 'writing skills', 'listening']} 
                imageSrc={img9} 
                score='2' 
                level='7'
                state='3'/>


      </div>
    );
  }
}

export default App;
